import React from "react";
import Header from "./header";
import Sidebar from "./sidebar";
import TaskList from "./taskList";

function Home() {
  return (
    <>
      <Header />
      <div className="home-layout">
        <Sidebar />
        <div className="task-list-container">
          <TaskList />
        </div>
      </div>
    </>
  );
}

export default Home;
